sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var successCount=(inputs.successCount);
var failureCount=(inputs.failureCount);
var inprogress=(inputs.inprogress);
    var individualResponse=inputs.productResponse;
    var responseArray=inputs.responseArray;


    if (individualResponse && typeof individualResponse ==='object'){
        individualResponse=individualResponse;
    }
    else if (individualResponse){
        individualResponse=JSON.parse(individualResponse);
    }



    if (responseArray && typeof responseArray ==='object'){
        responseArray=responseArray;
    }
    else if (responseArray){
        responseArray=JSON.parse(responseArray);
    }

    if(inputs.state=="inprogress"){
        inprogress+=1;
    }
    else if(individualResponse.status && individualResponse.status =="Success"){
        successCount+=1;
        delete individualResponse.status;
        responseArray.responses.push(individualResponse);
    }
    else{
        failureCount+=1;
    }
    outputs.inprogress=inprogress;
    outputs.result=responseArray
    outputs.success=successCount;
    outputs.faliure=failureCount;
    
})(inputs, outputs);

